                    method: ""POST"",
                    headers:
                    {
                        ""RequestVerificationToken"": t
                    },
                    url: ""/Produtos/Deletar"",
                    data: { id: idRecebido },
                    success: function (data) {
                        console.log(data);
                        $("".modal"").modal(""hide"");
                        location.reload(true);
                    }
                })
            });

        };


    </script>
